import React from "react";

class Titulo extends React.Component{
    constructor(prop){
        super(prop);
        this.conteudo= {
            tit: "FATEC",
            text: "Faculdade de Tecnologia de Presidente Prudente",
            link: "https://www.vestibularfatec.com.br/home/"
        }

    }

    getTitulo() {
        const element = <h1>Component Titulo com classe!</h1>;
        return element;
    }

    render() {
        return this.getTitulo();
        
    }
    
}

export default Titulo;
